import React from 'react';

const SignOut = () => {
    useEffect(() => {
        fetch('http://127.0.0.1:8000/spotify/user/profile', {
                method: 'GET',
                credentials: 'include',
            })
            .then((resp) => {
                return resp.json();
            })
            .then((data) => {
                if (data === '') {
                    window.location.href = '/';
                }
            })
            .catch((err) => {
                return console.error(err);
            })
    });

    return (
        <div>
            <h1>Logging out...</h1>
        </div>
    );
}

export default SignOut;
